import React, { Component } from 'react'

export default class SelectBox extends Component {
    state = {
        selectValue: 0
    }

    handleChange = (e) => {
        this.setState({
            selectValue: e.target.value
        })
    }
    render() {
        //console.warn(this.state.selectValue)

        const adults = [{'id': 0, 'value': 1}, {'id': 1, 'value': 2}]
        const children = [{'id': 0, 'value': 0}, {'id': 1, 'value': 1}, {'id': 2, 'value': 2}]

      return (
              <select 
              value={this.state.selectValue} 
              onChange={this.handleChange} 
              disabled={this.props.checked == false}
              >
                <option value="0">0</option>
                <option value="1">1</option>
                {this.props.children == true ? <option value="2">2</option> : null}
              </select>
      );
    }
  }
